import "./LandingPage.css";
function LandingPage() {
  $(function() {
    var taeb = $(".taeb-switch");
    taeb.find(".taeb").on("click", function() {
      var $this = $(this);
  
      if ($this.hasClass("active")) return;
  
      var direction = $this.attr("taeb-direction");
  
      taeb.removeClass("left right").addClass(direction);
      taeb.find(".taeb.active").removeClass("active");
      $this.addClass("active");
    });
  });
  
  return (
    <div className="LandingPageContainer">
      <main className=" d-flex flex-row justify-content-around align-items-center">
        <div className="col-3 d-flex justify-content-center align-items-center"></div>
        <div className="col-6 d-flex justify-content-center align-items-center">
          <h3
            style={{ color: "#32297C", fontSize: "1.4vw", textAlign: "center" }}
          >
            პირდაპირი უცხოური ინვესტიციები
            <br /> სექტორების მიხედვით
          </h3>
        </div>
        <div className="col-3 d-flex justify-content-center align-items-center">
          <div class="wrapper">
            <div class="taeb-switch left text-center">
              <div class="taeb active" taeb-direction="left">
                List
              </div>
              <div class="taeb" taeb-direction="right">
                Map
              </div>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}
export default LandingPage;
